/**
 * @classdesc
 * A control to display a loader image (typically an animated GIF) when
 * the map tiles are loading, and hide the loader image when tiles are
 * loaded
 *
 * @constructor
 * @extends {ol.control.Control}
 * @param {olx.control.LoadingPanelOptions} opt_options Options.
 * 
 * @author Emmanuel Blondel
 *
 */
(function (root, factory) {
  if (typeof define === 'function' && define.amd) {
    // AMD. Register as an anonymous module unless amdModuleId is set
    define([], function () {
      return (factory());
    });
  } else if (typeof exports === 'object') {
    // Node. Does not work with strict CommonJS, but
    // only CommonJS-like environments that support module.exports,
    // like Node.
    module.exports = factory();
  } else {
    factory();
  }
}(this, function () {

	ol.control.Snapshot = function(opt_options) {
	  var options = opt_options ? opt_options : {};

	  /**
	   * @type {integer}
	   * @private
	   */
	  this.dpi_default_ = (function () {
    	  	for (var i = 56; i < 2000; i++) {
        		if (matchMedia("(max-resolution: " + i + "dpi)").matches === true) {
           		return i;
        	}
    	   }
    	   return i;
	  })();

	  /**
	   * @type {integer}
	   * @private
	   */
	  this.dpi_ = options.dpi ? options.dpi : this.dpi_default_;

	  
	  var className = options.className ? options.className : 'ol-snapshot';
	  var tipLabel = options.tipLabel ? options.tipLabel : 'Snapshot';
	  var label = options.label ? options.label : '<img title="'+tipLabel+'" alt="" src="data:image/png;base64," />';
	  

	  var button = document.createElement('button');
	  button.setAttribute('title', tipLabel);
	  button.innerHTML = label;

	  var this_ = this;

	  button.onclick = function(e) {
		this_.handleClick_(e);
	  }
	  button.ontouchstart = function(e) {
		this_.handleClick_(e);
	  }

	  var element = document.createElement('div');
	  element.className = className + ' ' + 'ol-unselectable' + ' ' + 'ol-control';
	  element.appendChild(button);

	  ol.control.Control.call(this, {
		element: element,
		target: options.target
	  });
	};

	ol.inherits(ol.control.Snapshot, ol.control.Control);

	/**
	 * @param {goog.events.BrowserEvent} event The event to handle
	 * @private
	 */
	ol.control.Snapshot.prototype.handleClick_ = function(event) {
	  event.preventDefault();
	  this.handleSnapshot_();
	};


	/**
	 * Function to handle the snapshot. To trigger on click
	 * @private
	 */
	ol.control.Snapshot.prototype.handleSnapshot_ = function() {
	  var this_ = this;
	  var map = this.getMap();
	  this.getMap().once('postcompose', function(event) {
			console.log("Setting snapshot with DPI " + this_.dpi_);
			var dpiCtx = this_.setDPI_(event.context.canvas, this_.dpi_);
			var canvas = dpiCtx.canvas;
			var fileName = "map.png";
			if (navigator.msSaveBlob) {
				navigator.msSaveBlob(canvas.msToBlob(), fileName);
			} else {
				canvas.toBlob(function(blob){
					saveAs(blob, fileName);
				});
			}
	  });
      this.getMap().renderSync();
	};
	
	/**
	 * Function to set the DPI for current canvas
	 * @param {HTMLCanvas} the current canvas
	 * @param {integer} the DPI
	 * @private
	 */
	ol.control.Snapshot.prototype.setDPI_ = function(canvas, dpi) {
		
		// Get size information.
		var mapSize = this.getMap().getSize();
		var width = mapSize[0];
		var height = mapSize[1];

		// Backup the canvas contents.
		var scaleFactor = dpi / this.dpi_default_;
		var oldScale = canvas.width / width;
		var backupScale = scaleFactor / oldScale;
		var backup = canvas.cloneNode(false);
		backup.getContext('2d').drawImage(canvas, 0, 0);

		// Resize the canvas.
		var ctx = canvas.getContext('2d');
		canvas.width = Math.ceil(width * scaleFactor);
		canvas.height = Math.ceil(height * scaleFactor);

		// Redraw the canvas image and scale future draws.
		ctx.setTransform(backupScale, 0, 0, backupScale, 0, 0);
		ctx.drawImage(backup, 0, 0);
		ctx.setTransform(scaleFactor, 0, 0, scaleFactor, 0, 0);
		return({canvas: canvas, context: ctx});
	};
	
}));